import React, {Component} from "react";
import Actor from "../actor/actor";

function Player({ skin }) {

    const data = {
        h: 32,
        w: 32
    }

    return(
        <div style={{height: "600px", width: "600px", backgroundColor: "#000000"}}>
            <Actor sprite={skin} data={data} />
        </div>
    );
}

export default Player;
